import React from "react";
import Book from "./Book";

export default function BookList({ books, onSelectBook }) {
  return (
    <ul>
      {books.map((book) => (
        <Book
          key={book.id}
          book={book}
          onSelectBook={() => onSelectBook(book.id)}
        />
      ))}
    </ul>
  );
}
